import React from 'react';
import SignInForm from './SignInForm';
import SignUpForm from './SignUpForm';
import { Google } from '../helpers/Icons';
import { Link } from 'react-router-dom';

const FormContainer = () => {
	return (
		<div className='form'>
			<div className='form_section-top'>
				<span>
					<h1 className='form_section-top-text'>Hey there,</h1>
					<h2 className='form_section-top-text'>welcome back</h2>
				</span>
				<div className='form_btns'>
					<button className='form_btns-signin'>Sign in</button>
					<button className='form_btns-signup'>Sign up</button>
				</div>
			</div>
			<div className='form_section-middle'>
				<SignInForm />
			</div>
			<h3 className='form_section-bottom'>
				<Link>
					Or sign in with <Google />
				</Link>
			</h3>
		</div>
	);
};

export default FormContainer;
